67233931923175781	/opt/airflow/dags/custom/nomajde-sync.py	2024-12-05 09:04:12.068083+00	#\n# Copyright (c) 2024 NOMANA-IT and/or its affiliates.\n# All rights reserved. Use is subject to license terms.\n#\nfrom airflow import DAG\nfrom airflow.operators.python import PythonOperator\nfrom airflow.utils.dates import days_ago\nfrom liberty.plugins.database.utils.db_copy import copy_table\nimport logging\n\n# Default arguments for all DAGs\ndefault_args = {\n    'owner': 'airflow',\n    'depends_on_past': False,\n    'start_date': days_ago(1),\n    'email_on_failure': False,\n    'email_on_retry': False,\n    'retries': 1,\n}\n\ndag = DAG(\n    dag_id="nomajde-sync-daily-1",\n    default_args=default_args,\n    description='Synchronize JDE tables to Nomajde',\n    schedule_interval='30 2 * * *',\n    tags=['nomajde'],\n    catchup=False,\n)\n\n# Start task\nstart = PythonOperator(\n    task_id="start",\n    python_callable=lambda: logging.info("Jobs started"),\n    dag=dag\n)\n\ntables = [\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F0004', 'source_schema': 'PS920CTL', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F0005', 'source_schema': 'PS920CTL', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F9200', 'source_schema': 'DD920', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F9202', 'source_schema': 'DD920', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F9210', 'source_schema': 'DD920', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F9860', 'source_schema': 'OL920', 'target_schema': 'nomajde'},\n    {'conn_source': 'jde_conn', 'conn_target': 'nomajde_conn', 'table_name': 'F9865', 'source_schema': 'OL920', 'target_schema': 'nomajde'},\n]\n\n# Create tasks dynamically for each table sync\nsync_tasks = []\nfor table in tables:\n    task = PythonOperator(\n        task_id=f'sync_{table["table_name"]}',\n        python_callable=copy_table,\n        op_kwargs=table,\n        dag=dag,\n    )\n    sync_tasks.append(task)\n\n# End task\nend = PythonOperator(\n    task_id="end",\n    python_callable=lambda: logging.info("Jobs completed successfully"),\n    dag=dag\n)\n\n# Set dependencies: Start -> Sync tasks -> End\nstart >> sync_tasks >> end
