ALTER PROCEDURE liberty.create_application(IN dbname character varying) OWNER TO liberty;

--
-- Name: get_insert_columns(integer, text, text); Type: FUNCTION; Schema: liberty; Owner: liberty
--

CREATE FUNCTION liberty.get_insert_columns(id integer, crud text, dbtype text) RETURNS TABLE(column_name text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    dynamic_query TEXT;
    columns_text TEXT;
BEGIN
    -- Retrieve the dynamic query from the table
        RETURN QUERY 
                SELECT trim(both ' ' FROM unnest(string_to_array(regexp_replace(substring(QUERY_SQLQUERY FROM '\((.*?)\)'), E'[\r\n]+'::text, '', 'g'), ',')))
                FROM LY_QRY_SQL
                WHERE QUERY_CRUD = crud AND QUERY_DBTYPE = dbtype AND QUERY_ID = id
                ORDER BY QUERY_ID;
END
$$;


ALTER FUNCTION liberty.get_insert_columns(id integer, crud text, dbtype text) OWNER TO liberty;

--
-- Name: get_query_columns(integer, text, text); Type: FUNCTION; Schema: liberty; Owner: liberty
--

CREATE FUNCTION liberty.get_query_columns(id integer, crud text, dbtype text) RETURNS TABLE(column_name text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    dynamic_query TEXT;
    result jsonb;
    column_name_rec RECORD;
BEGIN
    -- Retrieve the dynamic query from the table
    SELECT QUERY_SQLQUERY INTO dynamic_query
    FROM LY_QRY_SQL
    WHERE QUERY_ID = id AND QUERY_CRUD = crud AND QUERY_DBTYPE = dbtype;

    -- Execute the dynamic query and fetch the result
    EXECUTE '
        WITH query AS (
            SELECT jsonb_agg(t) AS json_result
            FROM (' || dynamic_query || ') t
        ),
        json_keys AS (
            SELECT jsonb_object_keys((json_result->0)::jsonb) AS column_name
            FROM query
        )
        SELECT json_agg(upper(column_name)) AS result
        FROM json_keys'
    INTO result;

    -- Iterate over the JSON array and return each column name
    FOR column_name IN
        SELECT * FROM jsonb_array_elements_text(result)
    LOOP
        RETURN NEXT;
    END LOOP;

    -- End the function
    RETURN;
END;
$$;


