     ) AUTH ON AUTH.AUT_MENU_SEQ_UKID = PARENT_MENUS.MENU_SEQ_UKID AND AUTH.USR_ID = CHILD_MENUS.USR_ID AND AUTH.ROL_ID = CHILD_MENUS.ROL_ID\n\n)\nSELECT \n  USR_ID, MENU_CHILD_ID, MAX(RUN) AUT_RUN\nFROM \n  USR_MENUS \nGROUP BY\n  USR_ID, MENU_CHILD_ID\n) AUTH ON LY_MENUS.MENU_SEQ_UKID = AUTH.MENU_CHILD_ID\nLEFT JOIN LY_MENUS_L\n    ON LY_MENUS_L.LNG_ID = :LNG_ID AND LNG_SEQ_UKID = MENU_SEQ_UKID\n) MENUS\nLEFT JOIN\n  LY_MENUS_FILTERS FLT\n  ON FLT.MENU_SEQ_UKID = MENUS.KEY_ATTRIBUTES \n GROUP BY\n    LNG_ID,\n    USR_ID,\n    MENU_COMPONENT,\n    MENU_COMPONENT_ID,\n    MENU_LABEL,\n    KEY_ATTRIBUTES,\n    MENU_PARENT_ID,\n    MENU_CHILD_ID,\n    MENU_LEVEL,\n    AUT_RUN\n	KEY_ATTRIBUTES	admin	2024-07-17 08:13:37.036
