   COL_DISABLED,\n        COL_REQUIRED,\n        COL_KEY,\n        COL_CDN_ID,\n        DD_FIXED_PARAMS\n    FROM LY_DLG_FRM\n    INNER JOIN LY_DLG_COL ON LY_DLG_COL.FRM_ID = LY_DLG_FRM.FRM_ID \n    LEFT JOIN LY_DLG_TAB ON LY_DLG_TAB.FRM_ID = LY_DLG_FRM.FRM_ID AND LY_DLG_TAB.TAB_ID = LY_DLG_COL.TAB_ID\n    LEFT JOIN Dictionary_CTE DD ON DD.DD_ID = COL_DD_ID AND DD.DD_LANGUAGE = :LNG_ID\n),\nFilteredDialog_CTE AS (\n    SELECT \n        DLG.LNG_ID,\n        DLG.FRM_ID,\n        DLG.TAB_ID,\n        DLG.TAB_SEQ,\n        DLG.COL_ID,\n        COL_SEQ,\n        COL_COLSPAN,\n        COL_COMPONENT,\n        COL_COMPONENT_ID,\n        COL_DD_ID,\n        COL_LABEL,\n        COL_TARGET,\n        COL_TYPE,\n        COL_RULES,\n        COL_RULES_VALUES,\n        COL_DEFAULT,\n        COL_VISIBLE,\n        COL_DISABLED,\n        COL_REQUIRED,\n        COL_KEY,\n        COL_CDN_ID,\n        DD_FIXED_PARAMS,\n        STRING_AGG(\n            CASE \n                WHEN FLT_TYPE = 'DD' AND FLT_SOURCE IS NOT NULL \n                    THEN COALESCE(FLT_TARGET, FLT_SOURCE) || '=' || FLT_SOURCE \n                ELSE NULL \n            END, \n            ';'\n            ORDER BY FLT_ID\n        ) AS DYNAMIC_PARAMS,\n        STRING_AGG(\n            CASE \n                WHEN FLT_TYPE = 'VALUE' AND FLT_VALUE IS NOT NULL \n                    THEN FLT_TARGET || '=' || FLT_VALUE \n                ELSE NULL \n            END, \n            ';'\n            ORDER BY FLT_ID\n        ) AS FIXED_PARAMS,\n        STRING_AGG(\n            CASE \n                WHEN FLT_TYPE = 'POOL' \n                    THEN COALESCE(FLT_SOURCE, FLT_VALUE) \n                ELSE NULL \n            END, \n            ';'\n            ORDER BY FLT_ID\n        ) AS POOL_PARAMS,\n        STRING_AGG(\n            CASE \n                WHEN FLT_TYPE = 'OUT' AND FLT_SOURCE IS NOT NULL \n                    THEN COALESCE(FLT_TARGET, FLT_SOURCE) || '=' || FLT_SOURCE \n                ELSE NULL \n            END, \n            ';'\n            ORDER BY FLT_ID\n        ) AS OUTPUT_PARAMS\n    FROM Dialog_CTE DLG\n    LEFT JOIN LY_DLG_FILTERS FLT ON FLT.FRM_ID = DLG.FRM_ID AND FLT.COL_ID = DLG.COL_ID\n    GROUP BY\n        DLG.LNG_ID,\n        DLG.FRM_ID,\n        DLG.TAB_ID,\n        DLG.TAB_SEQ,\n        DLG.COL_ID,\n        COL_SEQ,\n        COL_COLSPAN,\n        COL_COMPONENT,\n        COL_COMPONENT_ID,\n        COL_DD_ID,\n        COL_LABEL,\n        COL_TARGET,\n        COL_TYPE,\n        COL_RULES,\n        COL_RULES_VALUES,\n        COL_DEFAULT,\n        COL_VISIBLE,\n        COL_DISABLED,\n        COL_REQUIRED,\n        COL_KEY,\n        COL_CDN_ID,\n        DD_FIXED_PARAMS\n)\nSELECT \n    DLG_COL.LNG_ID,\n    DLG_COL.FRM_ID,\n    DLG_COL.TAB_ID,\n    DLG_COL.TAB_SEQ,\n    DLG_COL.COL_ID,\n    DLG_COL.COL_SEQ,\n    DLG_COL.COL_COLSPAN,\n    DLG_COL.COL_COMPONENT,\n    DLG_COL.COL_COMPONENT_ID,\n    DLG_COL.COL_DD_ID,\n    DLG_COL.COL_LABEL,\n    DLG_COL.COL_TARGET,\n    DLG_COL.COL_TYPE,\n    DLG_COL.COL_RULES,\n    DLG_COL.COL_RULES_VALUES,\n    DLG_COL.COL_DEFAULT,\n    DLG_COL.COL_VISIBLE,\n    DLG_COL.COL_DISABLED,\n    DLG_COL.COL_REQUIRED,\n    DLG_COL.COL_KEY,\n    DLG_COL.COL_CDN_ID,\n    DLG_COL.DYNAMIC_PARAMS,\n    COALESCE(DLG_COL.FIXED_PARAMS, DD_FIXED_PARAMS) FIXED_PARAMS,\n    DLG_COL.POOL_PARAMS,\n    DLG_COL.OUTPUT_PARAMS,\n    STRING_AGG(\n        CASE \n            WHEN CDN_TYPE = 'DD' AND CDN_SOURCE IS NOT NULL \n                THEN CDN_TARGET || '=' || CDN_SOURCE \n            ELSE NULL \n        END, \n        ';'\n    ) AS CDN_DYNAMIC_PARAMS,\n    STRING_AGG(\n        CASE \n            WHEN CDN_TYPE = 'VALUE' AND CDN_VALUE IS NOT NULL \n                THEN CDN_TARGET || '=' || CDN_VALUE \n            ELSE NULL \n        END, \n        ';'\n    ) AS CDN_FIXED_PARAMS\nFROM FilteredDialog_CTE DLG_COL\nLEFT JOIN LY_DLG_COL_CDN CDN ON CDN.FRM_ID = DLG_COL.FRM_ID AND CDN.COL_ID = DLG_COL.COL_ID\nGROUP BY\n    DLG_COL.LNG_ID,\n    DLG_COL.FRM_ID,\n