25	generic	GET	nomasx1	WITH activeUsers as (\nSELECT\n        USR_APPS_ID,COUNT(DISTINCT USR_ID) JDE_ACTIVE_USERS\n    FROM\n        SECURITY_USERS\n    INNER JOIN\n        SECURITY_ASSIGNMENTS\n        ON RLU_APPS_ID = USR_APPS_ID\n        AND RLU_USER_ID = USR_ID\n    WHERE\n        USR_STATUS = '01'\n    GROUP BY USR_APPS_ID\n),\ntransactionUsers as (\nSELECT\n        USR_APPS_ID,COUNT(DISTINCT USR_ID) JDE_TRANSACTION_USERS\n    FROM\n        SECURITY_USERS\n    INNER JOIN\n        LICENSE_JDE_USERS\n        ON LUSR_APPS_ID = USR_APPS_ID\n        AND TRIM(LUSR_USER_ID) = USR_ID\n    WHERE\n         USR_STATUS = '01'\n          AND LUSR_DT_TRANSACTION  >= SYSDATE  - 90\n    GROUP BY\n        USR_APPS_ID\n),\nnoTransactionUsers as (\nSELECT\n        USR_APPS_ID,COUNT(DISTINCT USR_ID) JDE_NOTRANSACTION_USERS\n    FROM\n        SECURITY_USERS\n    LEFT JOIN\n        LICENSE_JDE_USERS\n        ON LUSR_APPS_ID = USR_APPS_ID\n        AND TRIM(LUSR_USER_ID) = USR_ID\n    WHERE\n          USR_STATUS = '01'\n          AND LUSR_USER_ID IS NULL\n    GROUP BY\n        USR_APPS_ID\n),\ntransactionNoUsers as (\nSELECT\n        LUSR_APPS_ID,COUNT(DISTINCT LUSR_USER_ID) JDE_TRANSACTION_NOUSERS\n    FROM\n        LICENSE_JDE_USERS\n    LEFT JOIN\n        SECURITY_USERS\n        ON USR_APPS_ID = LUSR_APPS_ID\n        AND TRIM(LUSR_USER_ID) = USR_ID\n    WHERE\n      USR_ID IS NULL\n      AND LUSR_DT_TRANSACTION  >= SYSDATE  - 90\n    GROUP BY\n        LUSR_APPS_ID\n)\nSELECT\n    APPS_ID,\n    NVL(JDE_ACTIVE_USERS,0) JDE_ACTIVE_USERS,\n    NVL(JDE_TRANSACTION_USERS,0) JDE_TRANSACTION_USERS,\n    NVL(JDE_NOTRANSACTION_USERS,0) JDE_NOTRANSACTION_USERS,\n    NVL(JDE_TRANSACTION_NOUSERS,0) JDE_TRANSACTION_NOUSERS\nFROM\n    SETTINGS_APPLICATIONS \nLEFT JOIN \n    activeUsers ON APPS_ID = activeUsers.USR_APPS_ID\nLEFT JOIN \n    transactionUsers ON APPS_ID = transactionUsers.USR_APPS_ID\nLEFT JOIN \n    noTransactionUsers ON APPS_ID = noTransactionUsers.USR_APPS_ID\nLEFT JOIN \n    transactionNoUsers ON APPS_ID = transactionNoUsers.LUSR_APPS_ID\nWHERE APPS_TYPE = 'JDE'	APPS_ID	admin	2024-09-02 11:02:39.451
