CREATE PROCEDURE nomasx1.purge_archive_data(IN apps_id integer, IN retention integer)
    LANGUAGE plpgsql
    AS $_$
BEGIN
   DELETE FROM db_ora_features$ WHERE oraf_apps_id = APPS_ID and oraf_audit_date <= NOW()::DATE - retention;
   DELETE FROM db_ora_licenses$ WHERE oral_apps_id = APPS_ID and oral_audit_date <= NOW()::DATE - retention;
   DELETE FROM db_ora_options$ WHERE orao_apps_id = APPS_ID and orao_audit_date <= NOW()::DATE - retention;
   DELETE FROM db_ora_properties$ WHERE orap_apps_id = APPS_ID and orap_audit_date <= NOW()::DATE - retention;
   DELETE FROM db_ora_partitions$ WHERE opar_apps_id = APPS_ID and opar_audit_date <= NOW()::DATE - retention;
   DELETE FROM security_assignments$ WHERE rlu_apps_id = APPS_ID and rlu_dt_refresh <= NOW()::DATE - retention;
   DELETE FROM security_roles$ WHERE rol_apps_id = APPS_ID and rol_dt_refresh <= NOW()::DATE - retention;
   DELETE FROM security_users$ WHERE usr_apps_id = APPS_ID and usr_dt_refresh <= NOW()::DATE - retention;
   DELETE FROM security_users_data$ WHERE usrd_apps_id = APPS_ID and usrd_dt_refresh <= NOW()::DATE - retention;
   DELETE FROM security_users_prop$ WHERE usrp_apps_id = APPS_ID and usrp_audit_date <= NOW()::DATE - retention;
   DELETE FROM sod_conflict_summary$ WHERE cfs_apps_id = APPS_ID and cfs_refresh <= NOW()::DATE - retention;

   RAISE INFO 'Archive Data purge successfully for id: %', APPS_ID;
 END;
$_$;


