--
-- Name: license_jde_usage; Type: MATERIALIZED VIEW; Schema: nomasx1; Owner: nomasx1
--

CREATE MATERIALIZED VIEW nomasx1.license_jde_usage AS
 SELECT settings_applications.apps_id,
    settings_applications.apps_name,
    settings_lic_components.cpt_id,
    settings_lic_components.cpt_lists,
    settings_lic_components.cpt_category,
    settings_lic_components.cpt_component,
    count(DISTINCT all_users.ser_user_id) AS users_count,
    count(DISTINCT enabled_users.usr_id) AS active_users_count
   FROM (((((( SELECT security_rights.ser_apps_id,
            security_rights.ser_user_id,
            security_rights.ser_object,
            security_rights.ser_run
           FROM nomasx1.security_rights
          WHERE (NOT ((security_rights.ser_user_id)::text IN ( SELECT security_users_prop.usrp_id
                   FROM nomasx1.security_users_prop
                  WHERE ((((security_users_prop.usrp_technical)::text = 'Y'::text) OR ((security_users_prop.usrp_is_linked)::text = 'Y'::text)) AND (security_users_prop.usrp_apps_id = security_rights.ser_apps_id)))))) all_users
     JOIN nomasx1.settings_applications ON ((settings_applications.apps_id = all_users.ser_apps_id)))
     JOIN nomasx1.jde_objects ON (((jde_objects.jdeo_apps_id = settings_applications.apps_id) AND ((all_users.ser_object)::text = (jde_objects.jdeo_object)::text))))
     JOIN nomasx1.settings_jde_sy ON (((jde_objects.jdeo_sy)::text = (settings_jde_sy.syc_id)::text)))
     JOIN nomasx1.settings_lic_components ON ((settings_jde_sy.syc_cpt_id = settings_lic_components.cpt_id)))
     LEFT JOIN ( SELECT security_users.usr_apps_id,
            security_users.usr_id
           FROM nomasx1.security_users
          WHERE ((security_users.usr_dt_login > (CURRENT_DATE - 90)) AND (NOT ((security_users.usr_id)::text IN ( SELECT security_users_prop.usrp_id
                   FROM nomasx1.security_users_prop
                  WHERE ((((security_users_prop.usrp_technical)::text = 'Y'::text) OR ((security_users_prop.usrp_is_linked)::text = 'Y'::text)) AND (security_users_prop.usrp_apps_id = security_users.usr_apps_id))))))) enabled_users ON (((enabled_users.usr_apps_id = all_users.ser_apps_id) AND ((enabled_users.usr_id)::text = (all_users.ser_user_id)::text))))
  WHERE (((all_users.ser_user_id)::text <> '*ROLE'::text) AND ((all_users.ser_run)::text = 'Y'::text))
  GROUP BY settings_applications.apps_id, settings_applications.apps_name, settings_lic_components.cpt_id, settings_lic_components.cpt_lists, settings_lic_components.cpt_category, settings_lic_components.cpt_component
  WITH NO DATA;


ALTER MATERIALIZED VIEW nomasx1.license_jde_usage OWNER TO nomasx1;

